    return(
      <div>
        <h1>Listar pokemons</h1>
        {console.log(pokemons)}
            <li> {pokemons.result}</li>
          {pokemons.map(pokemon => (
          <li key={pokemon[0]}>
                <h1>{pokemon[0]}</h1>

            </li>
        ))}
        
        
      </div>
    )

  }
  
}







export default Home;
